--
-- Table structure for table `book_model`
--

DROP TABLE IF EXISTS `book_model`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `book_model` (
  `book_id` int NOT NULL AUTO_INCREMENT,
  `name` varchar(100) NOT NULL,
  `price` decimal(10,0) DEFAULT NULL,
  `image` varchar(255) DEFAULT NULL,
  `like_amount` int DEFAULT NULL,
  `is_free_ship` tinyint(1) DEFAULT NULL,
  `description` text,
  `created_date` datetime DEFAULT NULL,
  `publish_date` datetime DEFAULT NULL,
  `author` varchar(100) NOT NULL,
  `page_number` int DEFAULT NULL,
  `weight` float DEFAULT NULL,
  `cover_page_type` varchar(50) DEFAULT NULL,
  `translator` varchar(100) DEFAULT NULL,
  `sale_id` int DEFAULT NULL,
  `point_id` int DEFAULT NULL,
  `manufacturer_id` int DEFAULT NULL,
  `category_id` int DEFAULT NULL,
  `attachment_id` int DEFAULT NULL,
  PRIMARY KEY (`book_id`),
  KEY `sale_id` (`sale_id`),
  KEY `point_id` (`point_id`),
  KEY `manufacturer_id` (`manufacturer_id`),
  KEY `category_id` (`category_id`),
  KEY `attachment_id` (`attachment_id`),
  CONSTRAINT `book_model_ibfk_1` FOREIGN KEY (`sale_id`) REFERENCES `sale_model` (`sale_id`),
  CONSTRAINT `book_model_ibfk_2` FOREIGN KEY (`point_id`) REFERENCES `point_model` (`point_id`),
  CONSTRAINT `book_model_ibfk_3` FOREIGN KEY (`manufacturer_id`) REFERENCES `manufacturer_model` (`manufacturer_id`),
  CONSTRAINT `book_model_ibfk_4` FOREIGN KEY (`category_id`) REFERENCES `category_model` (`category_id`),
  CONSTRAINT `book_model_ibfk_5` FOREIGN KEY (`attachment_id`) REFERENCES `attachment_model` (`attachment_id`)
) ENGINE=InnoDB AUTO_INCREMENT=136 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

